Verenigde Staten
Misdaad / Thriller
91 minuten

goed

met Nicolas Cage, Nicole Kidman en Cam Gigandet

Een echtpaar (Nicolas Cage &amp; Nicole Kidman) wordt gegijzeld door vier agressieve misdadigers die een grote slag willen slaan. 
Er ontstaan echter complicaties die voortvloeien uit een reeks aan onverwachte ontdekkingen van verraad en bedrog. Er blijken 
namelijk banden te zijn tussen de familie en de gijzelaars.
